import React, { useState } from 'react';
import { Grid, Paper, Avatar, TextField, Button } from '@material-ui/core';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import { Link } from 'react-router-dom';
import Typography from '@material-ui/core/Typography';
import { useHistory } from 'react-router-dom';
import { addUser } from '../../api/Api';






const initialValue = {
    fullname: '',
    district: '',
    state: '',
    mobilenumber: '',
    email: '',
    username: '',
    password: '',
}


const Sellcar = () => {


    const paperStyle = { padding: '20px', height: '100vh', width: 580, margin: '20px auto' }
    const avatarStyle = { backgroundColor: 'green' }
    const btnStyle = { margin: '20px auto' }

    const [user, setUser] = useState(initialValue);
    const { fullname, district, state, mobilenumber, email, username, password } = user;
    let history = useHistory();

    const onValueChange = (e) => {
        console.log(e.target.value);
        setUser({ ...user, [e.target.name]: e.target.value })
    }



    const addUserDetails = async () => {
        console.log("clicked");
        await addUser(user);
        history.push('/');
        //  console.log(user);
    }



    return (
        <>
            <Grid>
                <Paper elevation={10} style={paperStyle}>
                    <Grid align="center">
                        <Avatar style={avatarStyle}><LockOutlinedIcon /></Avatar>
                        <h2>Signup</h2>
                    </Grid>

                    <TextField name="creator" vaariant="outlined" label="Creator" fullWidth/>
                    <TextField name="title" vaariant="outlined" label="Title" fullWidth />
                    <TextField name="message" vaariant="outlined" label="Message" fullWidth />
                    <TextField name="tags" vaariant="outlined" label="Tags" fullWidth  />
                    <div className={classes.fileInput}>
                        <FileBase type="file" multiple={false}  />
                    </div>
                    <Button classNvariant="contained" color="primary" size="large" type="submit" fullWidth>Submit</Button>
                    <Button variant="contained" color="secondary" size="small" onClick={clear} fullWidth>Clear</Button>

                    <Button type="submit" color="primary" variant="contained" style={btnStyle} fullWidth onClick={() => addUserDetails()}>Register</Button>
                    <Typography color="textSecondary">
                        <Link to="/forgotpassword">Forgot Password</Link>
                    </Typography>
                    <Typography color="textSecondary" >
                        Don't have an Account  ?
                        <Link to="/signup"> Sign Up</Link>
                    </Typography>
                </Paper>
            </Grid>
        </>
    )
}

export default Sellcar;
